import React  from 'react'
import styled from 'styled-components'

const Title = styled.li`
    display:inl
    border        : 1px solid #000;
    border-radius : 25px;
    margin        : 10px;
`

const book = props => {
    return (
        <Title> {props.title} </Title>
    )
}
export default book
